Harvest Festivals

Travel Documentary hosted by Shana Jacobus, published by Discovery Channel broadcasted as part of DC Fantastic Festivals of the World series in 2007 - English narration


Information
------------------------------

Harvest Festivals are celebrated each May, the one month of rest between harvest and planting for the following year. The festivals are thanksgiving for a good harvest and in honor of the patron saint of the farmers. The most colorful celebrations are held in the towns of Lucban, Tayabas and Syriaya. In a country where the different dialects provide around 200 words for &quot;rice&quot;, this resource plays an integral part in the decorations, like the kiping, which are multicolored rice wafers. In Bulacan province the Carabao (water buffalo) festival and the fertility rites conclude these intense and happy Harvest Festivals.

